import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import { Home } from './Pages/Home';
import { Enlace1 } from './Pages/Enlace1';
import { Enlace2 } from './Pages/Enlace2';

function MyOtherButton() {
  return (
    <button className='AppCssButton'>Segundo bot√≥n</button>
  );
}

function App() {
  return (
  <>
    <Router>
      <Routes>
          <Route path="/" element={Home}/>
          <Route path="/Enlace_1" element={Enlace1}/>
          <Route path="/Enlace_2" element={Enlace2}/>
      </Routes>
    </Router>

  </>
);
}

export default App;
